import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const App = () => {
  return <div>
    <BrowserRouter>
      <Routes>
        <Route path='/'/>
      </Routes>
    </BrowserRouter>
  </div>;
};

export default App;
